//Personalização inicial
import React, { Component } from 'react'
import { Redirect } from 'react-router-dom';
import PersonalizationCarousel from '../components/PersonalizationCarousel';


class PersonalizationView extends Component {

    render() {
        // if (localStorage.getItem('user') == null) {
        //     return <Redirect to='/session' />;
        // }
        const dados = [
            { image: 'https://www.torredevigilancia.com/wp-content/uploads/2019/10/coringa-55.jpg', displayText: 'teste1' }
          ];
        return (
            <div>
                <PersonalizationCarousel dados={dados} />
            </div>
        )
    }
}

export default PersonalizationView;
